import styled from 'styled-components';
import { Link } from 'react-router-dom';

const ArchivesContainer = styled.div`
  max-width: 800px;
  margin: 0 auto;
  padding: 2rem;
`;

const ArticleLink = styled(Link)`
  text-decoration: none;
  color: #333;
  &:hover {
    color: #007bff;
  }
`;

function Archives() {
  return (
    <ArchivesContainer>
      <h1>文章归档</h1>
      <div>
        <h2>2024年</h2>
        <ul>
          <li>
            <ArticleLink to="/article/1">2024-03 - 示例文章标题</ArticleLink>
          </li>
          <li>
            <ArticleLink to="/article/2">2024-02 - 另一篇文章</ArticleLink>
          </li>
        </ul>
        <h2>2023年</h2>
        <ul>
          <li>
            <ArticleLink to="/article/3">2023-12 - 往年文章</ArticleLink>
          </li>
        </ul>
      </div>
    </ArchivesContainer>
  );
}

export default Archives;
